script: |
  super -f text -I q13709.spq | sort > q13709.out

inputs:
  - name: q13709.spq
    data: |
      SELECT ALL col0 * + 33 - + col1 * - ( - col0 ) AS col0 FROM tab1 (FORMAT parquet) WHERE - col2 NOT BETWEEN - col0 * - col0 + - col1 + - - col1 * - col0 - - col1 * - col2 AND + - 46 * + col2 * + + col1;
  - name: tab1

outputs:
  - name: q13709.out
    data: |
      -1274
      2380
      969
